css:
.github-GithubLoginView-Container {
  height: 100%;
  display: flex;
}
.github-GithubLoginView {
  height: 100%;
  display: flex;
}
.github-GithubLoginView .github-GithubLoginView-Subview {
  flex: 1;
  display: flex;
  flex-direction: column;
  align-self: center;
  align-items: center;
  padding: 20px;
}
.github-GithubLoginView .github-GithubLoginView-Subview > button,
.github-GithubLoginView .github-GithubLoginView-Subview > input {
  margin: 10px;
}
.github-GithubLoginView p {
  text-align: center;
  font-size: 16.25px;
  margin: 0;
}
.github-GithubLoginView p:first-child {
  margin-bottom: 20px;
}
.github-GithubLoginView p a {
  color: #5293d8;
}
.github-GithubLoginView input[type=text] {
  width: 100%;
}
